import React from 'react'
import './Footer.css'

const Footer = () => {
  return (
    <div className='footer__container'>
        <div className='footer__content'>
            <p>2023 &copy;Copyright <strong>AlbertaDucts</strong>. All Rights Reserved</p>
            <p>powered by <strong>YSF</strong>.</p>
        </div>
    </div>
  )
}

export default Footer
